import React from 'react';

function FeaturedSection() {
  return (
    <section
      className="relative bg-cover bg-center h-64 md:h-96 flex items-center justify-center text-cream px-6 rounded-lg mx-6 my-12"
      style={{ backgroundImage: "url('/assets/featured-coffee-beans.jpg')" }}
      aria-label="Featured coffee beans section"
    >
      <div className="bg-coffeeBrown bg-opacity-70 p-6 rounded-lg max-w-xl text-center">
        <h2 className="text-3xl font-semibold mb-4">Check out our best coffee beans</h2>
        <p className="text-sm">
          Discover the finest selection of coffee beans sourced from around the world, roasted to perfection.
        </p>
      </div>
    </section>
  );
}

export default FeaturedSection;
